import React from 'react';

const DocumentCard = ({ name, size, onDelete }) => (
    <div className="border border-gray-500 p-6 m-4" style={{ minWidth: 240 }}>
        <h3 className="truncate">{name}</h3>
        <div className="flex items-center">
            <div className="flex-1">{size}</div>
            <button className="btn btn-thin px-4" onClick={onDelete}>delete</button>
        </div>
    </div>
);

export default DocumentCard;
